package org.obrienlabs.radar;

import java.io.FileOutputStream;
import java.io.IOException;
import java.util.Base64;

public class Base64Testing {
    public static void main(String[] args) {
        //String base64String = "data:image/jpeg;base64,"; // Your Base64 string
        //String base64String = "data:image/gif;base64,";
        String base64String = "data:image/gif;base64,";
        String outputFileName = "_image.gif";

        try {
            // Decode Base64 string (remove the data:image/jpeg;base64, part if present)
            String imageDataBytes = base64String.substring(base64String.indexOf(",") + 1);
            byte[] decodedBytes = Base64.getDecoder().decode(imageDataBytes);

            // Write bytes to a JPG file
            FileOutputStream outputStream = new FileOutputStream(outputFileName);
            outputStream.write(decodedBytes);
            outputStream.close();

            System.out.println("Image saved successfully as " + outputFileName);
        } catch (IOException e) {
            System.err.println("Error saving image: " + e.getMessage());
        }
    }
}
